pragma solidity 0.6.12;

import "@openzeppelin/contracts/introspection/ERC165Checker.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155Receiver.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "./interfaces/IGenFactory.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
//import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

contract GenTickets is ERC1155, ERC1155Receiver {
    using SafeMath for uint;
    //using SafeERC20 for IERC20;

    struct GenTicket {
        uint256 numTickets;
        uint256 ticketSize;
    }
    // Ticket id mod numTicketTypes determines tier
    // Ticket id div numTicketTypes determines tranche of ticket
    // When ticket is swapped in for tokens, the next ticket is minted to the user

    address public underlyingToken;
    uint256[] public trancheLength;
    uint256[] public trancheWeightage;
    mapping(uint256 => GenTicket) public genTickets;
    uint public numTicketTypes;
    IGenFactory public factory;
    address public issuer;
    bool public active = false;
    uint256 private balanceNeeded = 0;
    // Expected TGE timestamp, start at max uint256
    uint public TGE = type(uint).max;

    bytes private constant VALIDATOR = bytes('JC');
    constructor (
        address _underlyingToken,
        uint256[] memory _numTickets,
        uint256[] memory _ticketSizes,//in wei
        uint[] memory _trancheWeightage,//in wei
        uint[] memory _trancheLength,//in seconds
        string memory _uri,
        IGenFactory _factory,
        address _issuer
    ) 
        public 
        ERC1155(_uri)
    {
        underlyingToken = _underlyingToken;
        trancheLength = _trancheLength;
        trancheWeightage = _trancheWeightage;
        factory = _factory;
        issuer = _issuer;

         for (uint i = 0; i < 50; i++){
            if (_numTickets.length == i){
                numTicketTypes = i;
                break;
            }

            balanceNeeded += _numTickets[i].mul(_ticketSizes[i]);
            genTickets[i] = GenTicket(_numTickets[i], _ticketSizes[i]);
        }
    }

    function returnTrancheLength() public view returns (uint256[] memory) {
        return (trancheLength);
    }
    function returnTrancheWeightage() public view returns (uint256[] memory) {
        return (trancheWeightage);
    }

    // For OpenSea
    function owner() public view virtual returns (address) {
        return issuer;
    }

    function updateTGE(uint timestamp) external {
        require(msg.sender == issuer, "GenTickets: Only issuer can update TGE");
        require(getBlockTimestamp() < TGE, "GenTickets: TGE already occurred");
        require(getBlockTimestamp() < timestamp, "GenTickets: New TGE must be in the future");
        // Determine whether we want to restrict this or not
        //require(!active, "Tokens are already active");

        TGE = timestamp;
    }

    function issue(address _to) external {
        require(msg.sender == issuer, "GenTickets: Only issuer can issue the tokens");
        require(!active, "GenTickets: Token is already active");
        IERC20(underlyingToken).transferFrom(msg.sender, address(this), balanceNeeded);

        address feeTo = factory.feeTo();
        bytes memory data;
        for (uint i = 0; i < 50; i++){
            if (numTicketTypes == i){
                break;
            }

            GenTicket memory ticketType = genTickets[i];

            uint256 feeAmount = 0;
            if (feeTo != address(0)) {
                // 1% of tickets generated is sent to feeTo address
                feeAmount = ticketType.numTickets.div(100);
                if (feeAmount == 0) {
                    feeAmount = 1;
                }
                _mint(feeTo, i, feeAmount, data);
            }

            _mint(_to, i, ticketType.numTickets - feeAmount, data);
        }

        active = true;
    }

    // to buld drop NFTs to users //emergency service// onlyIssuer
    function bulkAirdropTickets(address[] memory _to, uint256 _id, uint256 _amount) public {

        require(msg.sender == issuer, "GenTickets: Only issuer is allowed to AirDrop");
        require(IERC1155(address(this)).balanceOf(msg.sender, _id) >= (_to.length-1).mul(_amount), "GenTickets: Not enough tickets, the amount calculation exceeds the balance");

        for (uint256 i = 0; i < _to.length; i++) {
            safeTransferFrom(msg.sender, _to[i], _id, _amount, VALIDATOR);
        }
    }

    // In case, wants all tokens back after minting tickets //onlyIssuer
    function redeemIssuerTicket(uint256 _id, uint256 _amount) public {

        require(msg.sender == issuer, "GenTickets: Only issuer is allowed to redeem");

        uint tier = _id.mod(numTicketTypes);
        GenTicket memory ticketType = genTickets[tier];

        safeTransferFrom(address(msg.sender), address(this), _id, _amount, VALIDATOR);

        // Transfer underlying tokens with corresponding ticket size
        IERC20(underlyingToken).transfer(issuer, _amount.mul(ticketType.ticketSize));
    }

    function redeemTicket(address _to, uint256 _id, uint256 _amount) public {

        require(_amount > 0, "GenTicket: Invalid entry");
        require(IERC1155(address(this)).balanceOf(msg.sender, _id) >= _amount, "GenTickets: Not enough tickets, the amount exceeds the balance");

        uint tier = _id.mod(numTicketTypes);
        GenTicket memory ticketType = genTickets[tier];
        require(getBlockTimestamp() > TGE, "GenTickets: Project TGE not occured");

        uint256 redeemablePercentage;
        uint256 redeemedPercentage;
        uint256 redeemableCounter;
        uint256 redeemedCounter;

        uint tranche = _id.div(numTicketTypes);
        require(tranche < trancheLength.length, "GenTickets: Ticket has redeemed all tokens");//true

        for (uint i=0; i< trancheLength.length ; i++){

            if (i < tranche ){
                redeemedPercentage += (trancheWeightage[i].div(10**14));
                redeemedCounter += 1;
            }

            if (TGE.add(trancheLength[i]) <= getBlockTimestamp()){
                redeemablePercentage += (trancheWeightage[i].div(10**14));
                redeemableCounter += 1;
            } else{
                break;
            }
        }
        require(redeemablePercentage > 0, "GenTickets: zero amount cannot be claimed");
        require(redeemableCounter > redeemedCounter, "GenTickets: Tokens for this ticket are being vested");

        uint256 tokens = (ticketType.ticketSize).mul(_amount).mul(redeemablePercentage - redeemedPercentage).div(1000000);

        safeTransferFrom(address(msg.sender), address(this), _id, _amount, VALIDATOR);//4

        // Transfer underlying tokens with corresponding ticket size
        IERC20(underlyingToken).transfer(_to, tokens);
        bytes memory data;
        _mint(_to, _id.add(numTicketTypes.mul(redeemableCounter - redeemedCounter)), _amount, data);//12

    }

    function getBlockTimestamp() internal view returns (uint) {
        // solium-disable-next-line security/no-block-members
        return block.timestamp;
    }

    /**
     * ERC1155 Token ERC1155Receiver
     */
    function onERC1155Received(address _operator, address _from, uint256 _id, uint256 _value, bytes calldata _data) override external returns(bytes4) {
        if(keccak256(_data) == keccak256(VALIDATOR)){
            return 0xf23a6e61;
        }
    }

    function onERC1155BatchReceived(address _operator, address _from, uint256[] calldata _ids, uint256[] calldata _values, bytes calldata _data) override external returns(bytes4) {
        if(keccak256(_data) == keccak256(VALIDATOR)){
            return 0xbc197c81;
        }
    }
}
